    "contracts/NaveStaking.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity 0.8.1;

import "hardhat/console.sol";


import "./interfaces/INaveStaking.sol";
import "./interfaces/IVaultFactory.sol";
import "./SwapTX.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";


contract TEST_NaveStaking is INaveStaking, TEST_SwapTX, Ownable {
    using SafeERC20 for IERC20;
    using SafeERC20 for IERC20Metadata;

    IVaultFactory public factory;
    IERC20Metadata public tokenNave;
    IERC20 public stablecoin;
    uint256 public stablecoinDecimals;
    uint256 public totalStaked;
    uint256 public minStakingAmount;

    struct Staker {
        uint256 stakedAmount;
        uint256 lastActivity;
        uint256 claimableAmount;
    }

    mapping(address => Staker) public stakers;

    constructor(
      IVaultFactory _factory,
      address _stablecoin,
      uint256 _stablecoinDecimals
    ) {
        factory = _factory;
        tokenNave = IERC20Metadata(0x43642D8b7480b83355b83cf451dd1C4314B1260f);
        stablecoin = IERC20(_stablecoin);
        stablecoinDecimals = _stablecoinDecimals;
        minStakingAmount = 1;
    }

    function stake(
      uint256 amount
    ) external override returns(bool) {
        require(amount > minStakingAmount, "You must stake at least 1 token.");

        uint256 stakedAmount = stakers[msg.sender].stakedAmount;

        if (stakedAmount == 0) {
            stakers[msg.sender].lastActivity = block.timestamp;
        }
        else {
          uint256 userShare = (stakedAmount * 10000) / totalStaked;
          stakers[msg.sender].claimableAmount += calculateClaimableStablecoin(msg.sender);
        }

        uint256 balanceBefore = tokenNave.balanceOf(address(this));
        require(tokenNave.transferFrom(msg.sender, address(this), amount), "NAVE token transfer failed.");
        uint256 balanceAfter = tokenNave.balanceOf(address(this));
        uint256 actualAmount = balanceAfter - balanceBefore;

        stakers[msg.sender].stakedAmount += actualAmount;
        totalStaked += actualAmount;

        emit Stake(msg.sender, amount, block.timestamp);
        return true;
    }

    function withdraw() external override returns(bool){
        require(stakers[msg.sender].stakedAmount > 0, "You do not have NAVE tokens.");
        uint256 stakedAmount = stakers[msg.sender].stakedAmount;
        uint256 userShare = (stakedAmount * 10000) / totalStaked;

        require(userShare > 0, "You cannot claim stablecoins yet.");

        uint256 _lastActivity = stakers[msg.sender].lastActivity;
        uint256 stablecoinToClaim = stakers[msg.sender].claimableAmount + calculateClaimableStablecoin(msg.sender);
        stakers[msg.sender].claimableAmount = 0;
        stakers[msg.sender].lastActivity = block.timestamp;

        stablecoin.safeTransfer(msg.sender, stablecoinToClaim);
        tokenNave.safeTransfer(msg.sender, stakedAmount);

        stakers[msg.sender].stakedAmount = 0;
        totalStaked -= stakedAmount;

        emit Withdraw(msg.sender, stakedAmount, block.timestamp);
        emit Claim(msg.sender, stablecoinToClaim, block.timestamp);

        return true;
    }


    function withdrawAndClaim(uint256 amount) external returns(bool){
        uint256 stakedAmount = stakers[msg.sender].stakedAmount;
        require(stakedAmount >= amount , "You do not have enough NAVE tokens.");

        uint256 userShare = (stakedAmount * 10000) / totalStaked;

        require(userShare > 0, "You cannot claim stablecoins yet.");

        uint256 _lastActivity = stakers[msg.sender].lastActivity;
        uint256 stablecoinToClaim = stakers[msg.sender].claimableAmount + calculateClaimableStablecoin(msg.sender);
        stakers[msg.sender].claimableAmount = 0;
        stakers[msg.sender].lastActivity = block.timestamp;

        stablecoin.safeTransfer(msg.sender, stablecoinToClaim);
        tokenNave.safeTransfer(msg.sender, stakedAmount);

        stakers[msg.sender].stakedAmount = 0;
        totalStaked -= stakedAmount;

        emit Withdraw(msg.sender, stakedAmount, block.timestamp);
        emit Claim(msg.sender, stablecoinToClaim, block.timestamp);

        return true;
    }

    function claimStablecoin() external override returns (bool){

      require(stakers[msg.sender].stakedAmount > 0, "You do not have NAVE tokens.");
      uint256 stablecoinToClaim = stakers[msg.sender].claimableAmount + calculateClaimableStablecoin(msg.sender);
      stakers[msg.sender].claimableAmount = 0;
      stakers[msg.sender].lastActivity = block.timestamp;

      if (stablecoinToClaim > 0){
          stablecoin.safeTransfer(msg.sender, stablecoinToClaim);
      }

      emit Claim(msg.sender, stablecoinToClaim, block.timestamp);
      return true;
    }

    function calculateClaimableStablecoin(address _staker) public view returns (uint256) {

      uint256 stakedAmount = stakers[_staker].stakedAmount;
      uint256 userShare = (stakedAmount * 10000) / totalStaked;
      uint256 _lastActivity = stakers[_staker].lastActivity;

      uint256 timeDelta = block.timestamp - _lastActivity;
      uint256 stablecoinBalance = stablecoin.balanceOf(address(this));
      uint256 claimableStablecoin = (stablecoinBalance * userShare * timeDelta) / (totalStaked * 10000);

      claimableStablecoin /= tokenNave.decimals();
      claimableStablecoin *= stablecoinDecimals;

      return claimableStablecoin;
    }

    function updateMinimunStakingAmount(
      uint256 _newMinStakingAmount
    ) external override onlyOwner returns(bool){
      minStakingAmount = _newMinStakingAmount;
      return true;
    }

    function updateRewardStableCoin(
      address _newStablecoin,
      uint256 _stablecoinDecimals
    ) external override onlyOwner returns(bool){

      uint256 _stablecoinBalance = stablecoin.balanceOf(address(this));

      _swapTokensForBNB(
          address(stablecoin),
          _stablecoinBalance,
          address(this)
      );

      _swapBNBForTokens(
        _newStablecoin,
        address(this).balance,
        address(this)
      );

      address previousStablecoin = address(stablecoin);
      stablecoin = IERC20(_newStablecoin);
      stablecoinDecimals = _stablecoinDecimals;

      emit StableCoinUpdated(previousStablecoin, _newStablecoin, _stablecoinDecimals, block.timestamp);

      return true;
    }

}
