    "contracts/Swap.sol": {
      "content": "// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.1;


import "./interfaces/IPancakeRouter02.sol";
import "./interfaces/IPancakeFactory02.sol";
import "./interfaces/IWBNB.sol";

contract TEST_Swap  {

  //MAINNET
  IPancakeRouter02 public constant pancakeRouter02 = IPancakeRouter02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
  IPancakeFactory02 public constant pancakeFactory02 = IPancakeFactory02(0xcA143Ce32Fe78f1f7019d7d551a6402fC5350c73);


  function _wBNB() public view returns(address) {
      return pancakeRouter02.WETH();
  }

  function _getAmountOut(
      address _tokenIn,
      address _tokenOut,
      uint256 _amountIn
  ) internal view returns (uint256) {

      if (_tokenIn == _tokenOut) {
          return _amountIn;
      }

      address[] memory path;

      if (_tokenIn == _wBNB() || _tokenOut == _wBNB()) {
          path = new address[](2);
          path[0] = _tokenIn;
          path[1] = _tokenOut;
      }
      else {
          path = new address[](3);
          path[0] = _tokenIn;
          path[1] = _wBNB();
          path[2] = _tokenOut;
      }

      uint256[] memory amountOutMins = pancakeRouter02.getAmountsOut(
          _amountIn,
          path
      );

      return amountOutMins[path.length - 1];
  }


  function _checkPairs (
    address[] memory _tokenList
  ) internal view returns (bool) {
      for (uint256 i = 0; i < _tokenList.length; i++) {
        if(_tokenList[i] != _wBNB()){
          address pair = pancakeFactory02.getPair(_tokenList[i], _wBNB());
           if (pair == address(0)){
             return false; }
         }
       }
       return true;
  }

}
