    "contracts/SwapTX.sol": {
      "content": "// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.1;

import "hardhat/console.sol";

import "./interfaces/IPancakeRouter02.sol";
import "./interfaces/IPancakeFactory02.sol";
import "./interfaces/IWBNB.sol";
import "./Swap.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./libraries/Errors.sol";


contract TEST_SwapTX is TEST_Swap  {

  function _swapBNBForTokens(
      address _tokenOut,
      uint256 _bnbAmount,
      address _to
  ) internal
  {
      if (_tokenOut == _wBNB()){
        IWBNB(_wBNB()).deposit{value: _bnbAmount}();
      }
      else {
        address[] memory path = new address[](2);

        path[0] = _wBNB();
        path[1] = _tokenOut;

        pancakeRouter02.swapExactETHForTokensSupportingFeeOnTransferTokens{value: _bnbAmount}(
            0,
            path,
            _to,
            block.timestamp
        );
    }
  }


  function _swapTokensForBNB(
      address _tokenIn,
      uint256 _amountIn,
      address _to
  ) internal
  {

    if (_tokenIn == _wBNB()) {
        IWBNB(_wBNB()).withdraw(_amountIn);
    }
    else {
      address[] memory path = new address[](2);
      path[0] = _tokenIn;
      path[1] = _wBNB();

      address pair = pancakeFactory02.getPair(path[0], path[1]);
      require(pair != address(0), Errors.PAIR_NOT_EXIST);
      IERC20(_tokenIn).approve(pair, _amountIn);
      IERC20(_tokenIn).approve(address(pancakeRouter02), _amountIn);
      pancakeRouter02.swapExactTokensForETHSupportingFeeOnTransferTokens(
          _amountIn,
          0,
          path,
          _to,
          block.timestamp
      );
    }

  }

}
